import React, { Fragment } from "react";
import Bubble from 'react';

const Nav = () => {
  return (
    <Fragment>
      <div className="navC">
        <nav className="nav center">
          <h2 className="nav__title">SHOP</h2>
          <button className="btn">CARRO</button>
        </nav>
      </div>

      <Bubble/>
    </Fragment>
  );
};

export default Nav;
